import React, { useState, Suspense } from "react";
import { Canvas} from "@react-three/fiber";

import Box from './components/Box'


function App() {
  const [links, setLinks] = useState([
    {
        id: 1,
        color: 'green',
        name: 'Unversitas Terbuka 1',
        link: "https://google.com",
        toggle: true,
    },
    {
        id: 2,
        color: 'Blue',
        name: 'Unversitas Terbuka 2',
        link: "https://facebook.com",
        toggle: true,
    },
    {
        id: 3,
        color: 'blue',
        name: 'Unversitas Terbuka 3',
        link: "https://twitter.com",
        toggle: true,
    },
    {
        id: 4,
        color: 'red',
        name: 'Unversitas Terbuka 4',
        link: "https://twitter.com",
        toggle: true,
    },
    {
        id: 5,
        color: 'red',
        name: 'Unversitas Terbuka 5',
        link: "https://twitter.com",
        toggle: true,
    },
    {
      id: 6,
      color: 'red',
      name: 'Unversitas Terbuka 5',
      link: "https://twitter.com",
      toggle: true,
    },
  ])

  const length = links.length

  return (
  <>
  <Canvas camera={{position: [0,0,10]}}>
    <ambientLight intensity={0.3}/>
    <Suspense >
      <Box position={[0,0,2]} color={"blue"}/>
      <Box position={[2,0,2]} color={"green"}/>
      <Box position={[-2,0,2]} color={"red"}/>
    </Suspense>
  </Canvas>
  </>
  );
}

export default App;
